export const WeatherObjectCon = (location, temperature, cloudy, wind, Humidity, pressure, ForcastDate = new Date()) => {

    return {
        'Location': location,
        'ForcastDate': ForcastDate.getTime(),
        'Temperature': (temperature - 273.15).toFixed(2),
        'Cloudy': cloudy,
        'Wind': wind,
        'Humaidity': Humidity,
        'Pressure': pressure
    }
}
